import './portfolio.scss';

export default function PortfolioList({title}) {

    const list = [
        {
            id: 'featured',
            title: 'featured'
        },
        {
            id: 'web',
            title: 'web app'
        },
        {
            id: 'mobile',
            title: 'mobile app'
        },
        {
            id: 'design',
            title: 'design'
        },
        {
            id: 'content',
            title: 'content'
        },
    ]
    return (
        <div>
            <li className="portfolioList"></li>
        </div>
    )
}
